import React from "react";
import "./Header.css";

export default class Header extends React.Component
{
  constructor(props)
  {
    super(props);
  }
  render()
  {return (
      <span class="align-top"><div class="container-fluid" id="tbox">
        <p id="title">{this.props.title}</p>

      </div></span>
    );
  }
}
